import React from 'react';
import HtmlLogo from '../Assets/html.svg';
import CssLogo from '../Assets/css.svg';
import BsLogo from '../Assets/bootstrap.svg';
import jLogo from '../Assets/jquery.svg';
import JsLogo from '../Assets/javascript.svg';
import ReactLogo from '../Assets/react.svg';
import GitHubLogo from '../Assets/github.svg';
import GitLogo from '../Assets/git.svg';
import NodejsLogo from '../Assets/nodejs.svg';

class Stack extends React.Component {
  constructor(props){
    super(props)
  }

  render() {
    return (
      <div className="w-100 py-5 text-center" style={{backgroundColor:'#222831', color:'#EEEEEE'}}>
        <h1>My Tech Stack</h1>
        <p>I currently work with these technologies</p>
        <div className="d-flex g-20 flex-row flex-wrap w-100 px-md-5 justify-content-center" style={{maxWidth:600}}>
            <div className="my-3 my-md-4 mx-3 w-25 rounded-2 p-2" style={{maxWidth: 75, backgroundColor:'#EEEEEE', color:'#393E46'}}>
                <img src={HtmlLogo} className="w-100"/>
                <p>HTML</p>
            </div>
            <div className="my-3 my-md-4 mx-3 w-25 rounded-2 p-2" style={{maxWidth: 75, backgroundColor:'#EEEEEE', color:'#393E46'}}>
                <img src={CssLogo} className="w-100"/>
                <p>CSS</p>
            </div>
            <div className="my-3 my-md-4 mx-3 w-25 rounded-2 p-2" style={{maxWidth: 75, backgroundColor:'#EEEEEE', color:'#393E46'}}>
                <img src={JsLogo} className="w-100"/>
                <p>JavaScript</p>
            </div>
            <div className="my-3 my-md-4 mx-3 w-25 rounded-2 p-2" style={{maxWidth: 75, backgroundColor:'#EEEEEE', color:'#393E46'}}>
                 <img src={BsLogo} className="w-100"/>
                 <p>Bootstrap</p>
            </div>
            <div className="my-3 my-md-4 mx-3 w-25 rounded-2 p-2" style={{maxWidth: 75, backgroundColor:'#EEEEEE', color:'#393E46'}}>
                <img src={jLogo} className="w-100"/>
                <p>jQuery</p>
            </div>
            <div className="my-3 my-md-4 mx-3 w-25 rounded-2 p-2" style={{maxWidth: 75, backgroundColor:'#EEEEEE', color:'#393E46'}}>
                 <img src={ReactLogo} className="w-100"/>
                 <p>React.js</p>
            </div>
            <div className="my-3 my-md-4 mx-3 w-25 rounded-2 p-2" style={{maxWidth: 75, backgroundColor:'#EEEEEE', color:'#393E46'}}>
                 <img src={GitLogo} className="w-100"/>
                 <p>Git</p>
            </div>
            <div className="my-3 my-md-4 mx-3 w-25 rounded-2 p-2" style={{maxWidth: 75, backgroundColor:'#EEEEEE', color:'#393E46'}}>
                 <img src={GitHubLogo} className="w-100"/>
                 <p>GitHub</p>
            </div>
            <div className="my-3 my-md-4 mx-3 w-25 rounded-2 p-2" style={{maxWidth: 75, backgroundColor:'#EEEEEE', color:'#393E46'}}>
                 <img src={NodejsLogo} className="w-100"/>
                 <p>Nodejs</p>
            </div>
        </div>
      </div>
    );
  }
}

export { Stack }
